INSERT INTO `demand` VALUES ('Demand_201411222129540758', '状元乐后台管理', '', 'jxxyt', '1900-01-01 00:00:00', 'wbl', '1900-01-01 00:00:00', '已解决', '技术哥，可不可以将考生的考点提交页面优化下啊', '', '', '<p>\r\n	具体是这样的，因为考生输入自己的账号后，第一眼看到的是考点提交的页面，有些考生一下子会搞的莫名其妙，因为除了提交考点那几天外，其他时间的考生登录账号主要是查看自己的报名信息的，这里面能不能改动下。把第一眼看到的&ldquo;考点提交页面&rdquo;改为&ldquo;查看个人信息&rdquo;的页面。</p>\r\n', '<p>\r\n	可以，呵呵</p>\r\n<p>\r\n	好了</p>\r\n');
INSERT INTO `demand` VALUES ('Demand_201411251923449723', '状元乐后台管理', '', 'jxxyt', '1900-01-01 00:00:00', 'wbl', '1900-01-01 00:00:00', '处理中', '技术哥，网站有时候数据导不进去啥问题啊！', '', '', '<p>\r\n	时不时有内部接口异常，还有的比如今天啥都没反应，显示数据导入成功，但是刷新后数据都没了！另外，技术哥啊，向你提交问题的时候附件上传不了啊！</p>\r\n', '<p>\r\n	附件上传不了 解决了的啊</p>\r\n');
INSERT INTO `demand` VALUES ('Demand_201411252028199776', '状元乐后台管理', '', 'wbl', '2014-11-25 20:28:19', '', '1900-01-01 00:00:00', '已提交', '换台电脑登陆网速很慢', '', '', '换台电脑网速很慢，是不是缓冲的问题？但刷新很久了还是这样，个别界面也变化了，不知道是什么原因', '');
